import React, {useState, useEffect} from 'react';
import logo from '../foto/1.jpg';
import logo2 from '../foto/2.jpg';
import logo3 from '../foto/3.jpg';
import logo4 from '../foto/4.jpg';
import logo5 from '../foto/5.jpg';
import logo6 from '../foto/6.jpg';
import logo7 from '../foto/6.jpg';
import logoPlus from '../foto/plus.svg';
import {Container, Row	, Col, Card, CardGroup} from 'react-bootstrap';
import LightSpeed from 'react-reveal/LightSpeed';



function MomentKeluarga () {

const [kumpulan, setKumpulan] = useState([logo,logo2,logo3, logo4, logo5, logo6, logo7, logo5, logo6, logo7, logo5, logo6, logo7]);


const gayaText = {
	fontFamily : ' Arial, sans-serif',
	fontSize : '18px',
	color : 'gray'
}

const ukuranGambar = (e) => {
	e.target.style.width = '50px';
	//ounMouseOver={ukuranGambar}
}


	return (
		<>
		<LightSpeed right>
		<Container>
		<br />
		<center>
		<a><img src={logoPlus} style={{ height: '30px', width:'30px'}}/>Apa Moment Yang Terjadi Hari Ini?</a>
		</center>
		<br />
			<Row>
				<Col sm={4}>
					<medium className="text-muted">Today</medium>
				</Col>
			</Row>
			</Container>
			<Container>
		<CardGroup>
				{kumpulan.map((asi) => {
				return(
					<Card>
						<Card.Img variant="top" src={asi} />
				  </Card>
				  )
				})}
		</CardGroup>
		</Container>
		</LightSpeed>
				  </>

		)
}

export default MomentKeluarga;
